package com.huatandm.meetme.adapter;

public class MapsContant {

	private int venue_id; // 会议场地ID 　
	private String venue_name; // 会议场地名称 　
	private String venue_introduction; // 会议场地介绍 　
	private String venue_address; // 会议场地地址 　
	private String venue_map;

	public MapsContant() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getVenue_id() {
		return venue_id;
	}

	public void setVenue_id(int venue_id) {
		this.venue_id = venue_id;
	}

	public String getVenue_name() {
		return venue_name;
	}

	public void setVenue_name(String venue_name) {
		this.venue_name = venue_name;
	}

	public String getVenue_introduction() {
		return venue_introduction;
	}

	public void setVenue_introduction(String venue_introduction) {
		this.venue_introduction = venue_introduction;
	}

	public String getVenue_address() {
		return venue_address;
	}

	public void setVenue_address(String venue_address) {
		this.venue_address = venue_address;
	}

	public String getVenue_map() {
		return venue_map;
	}

	public void setVenue_map(String venue_map) {
		this.venue_map = venue_map;
	}
}
